INSERT INTO `aboutblog` VALUES (1, '宋瑶', '汉', '狮子座', '上海', '欢迎来到逐梦博客，本人是一名即将毕业的在校大学生，16年步入大学，大一期间很是懵懂，相当于是浪费了一年时间，直到大一暑假的一次在公司实习经历才知道自己应该学点技术了，所以从大二开始自己就一直在学习技术，最开始是从前端开始，恰好这一年学院成立了一个校企合作的创新创业中心，经过两轮的面试我也成功的进入到了双创中心的技术部，这里应该感谢我的一位室友，当初要不是他一直陪着我排队面试我可能就不会等下去了（当时面试的人太多了）。进入技术部后，更加激起了我学习的欲望（部门都是大佬，学习氛围好），从那之后基本是一有时间就会去办公室学习，因部门规定，大二的寒假也是留校学习了，到大二下学期认识了一位周博士，最开始是他手上的一个项目由于学长要出去实习了叫我过去帮忙（省的叫学长来回跑浪费时间），这应该是我第一次接触真实项目，当时负责修改一个node文件（1000多行纯js,还不是自己写的想要修改必须得先花时间看懂），大二暑假在上海实习了半个月，实习完回到学校然后就一直在周老师那边负责两个项目的主要内容（上个项目已完，这是两个新项目），这两个项目一做就是快一年的时间，一个高铁一个廉心宝，高铁的我一直在负责（难度比较大，尤其是导航，定位跟权限管理这一块），廉心宝我写完前台交给另外一个学长去负责了（相对来说业务逻辑比较简单），周老师答应项目完成会让公司给我一个项目经理的证明（很是期待），项目期间每天都是沉浸在代码中，这一年过的很累（但是很充足），此博客是本人大概花了两周时间用 Vue 搭建的(基于去年写的博客)。（理科出身，文笔不好，望大家喜欢）', '本科', 520, 99, 88, '江西宜春', '软件工程');

